CREATE TABLE `car_specs` (
  `car_spec_id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT '주식별자(PK)',
  `maker_id` bigint unsigned NOT NULL COMMENT 'maker 참조 식별자(FK)',
  `model_name` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '자동차 차량명',
  `body_type` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '세단/RV/SUV/승합/트럭/버스 (추후 분리 예정)',
  `generation_name` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '세대 구분 코드(없으면 차량명)',
  `model_year` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '판매 연도 (예: 2019~2023, 2019~현재)',
  `trim_name` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '트림명(없으면 공백)',
  `drivetrain_type` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '전륜/후륜/사륜 (추후 확장)',
  `fuel_type` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '연료 타입',
  `fuel_efficiency` float NOT NULL COMMENT '연비/전비',
  `displacement_cc` int NOT NULL COMMENT '배기량(cc) / EV는 배터리 용량 등 추후 정의',
  `transmission` tinyint NOT NULL DEFAULT '1' COMMENT '차량 변속기 0은 수동 1은 자동',
  `special_note` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '개조/옵션 등 특이사항',
  PRIMARY KEY (`car_spec_id`),
  KEY `fk_car_specs_makers` (`maker_id`),
  CONSTRAINT `fk_car_specs_makers` FOREIGN KEY (`maker_id`) REFERENCES `makers` (`maker_id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `chk_car_specs_transmission` CHECK ((`transmission` in (0,1)))
) ENGINE=InnoDB AUTO_INCREMENT=1728 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
